import React from "react";
import HeaderLogedin from "../components/headerLogedin";
import { Box, Divider, Paper, Stack, Typography } from "@mui/material";
import Grid from "@mui/material/Grid";

export default function Profile(params) {
  const ContainerStyle = {
    marginTop: "20px",
    marginBottom: "50px",
    padding: "30px",
    backgroundColor: "custom.main",
  };
  const ColumnStyle = {
    height: "100%",
    backgroundColor: "white",
    borderRadius: "3px",
  };
  const PositionStyle = {
    justifyContent: "flex-end",
    alignItems: "center",
    padding: "30px",
  };
  return (
    <>
      <HeaderLogedin />
      <Divider sx={{ marginTop: "80px" }} />
      <Paper sx={ContainerStyle} elevation={5}>
        <Grid sx={{ height: "600px" }} container spacing={2}>
          <Grid item xs={6} md={9}>
            <Box sx={ColumnStyle}></Box>
          </Grid>
          <Grid item xs={6} md={3}>
            <Box sx={ColumnStyle}>
              <Stack direction="row" sx={PositionStyle}>
                <Box>
                  <Typography variant="h5">به پلاک ۲۶ خوش آمدید</Typography>
                  <Typography
                    sx={{ mt: "10px", textAlign: "left" }}
                    variant="h5"
                  >
                    ۰۹۱۲۴۳۵۶۶۸۸
                  </Typography>
                </Box>

                <img
                  style={{
                    width: "50px",
                    height: "50px",
                    marginLeft: "20px",
                    borderRadius: "100px",
                  }}
                  src={require("../assets/images/Profile.png")}
                />
              </Stack>
            </Box>
          </Grid>
        </Grid>
      </Paper>
    </>
  );
}
